DROP TABLE IF EXISTS `merchant_pay_log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `merchant_pay_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `merchant_id` int(11) NOT NULL COMMENT '商家ID',
  `out_id` varchar(32) DEFAULT NULL COMMENT '外部支付用户ID(支付宝返回的唯一用户buyId号或者微信公众号返回的唯一openId号)',
  `pay_no` varchar(32) NOT NULL COMMENT '支付流水号（支付宝或者微信支付的流水号）',
  `pay_amount` decimal(10,2) NOT NULL COMMENT '支付金额',
  `pay_time` datetime NOT NULL COMMENT '支付时间(打款给商家的时间)',
  `pay_method` int(11) NOT NULL COMMENT '支付方式（1=支付宝扫码支付, 2=微信扫码支付, 3=前台扫码支付, 4=现金支付, 5=支付宝转账, 6=微信转账,7=其它）',
  `order_no` varchar(32) NOT NULL COMMENT '订单号(支付单订单号,用餐订单号,合并订单号)',
  `log_type` int(11) NOT NULL COMMENT '1=支付流水,2=退款流水',
  `log_source` int(11) NOT NULL COMMENT '日志记录来源(1=正常, 2=异常-属于手动查询支付宝或微信支付结果)',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `create_time` datetime DEFAULT NULL COMMENT '记录创建时间',
  `modify_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=313 DEFAULT CHARSET=utf8 COMMENT='移动支付流水';
